// Get centroid of a polygon for label placement
export function getWardCentroid(coordinates) {
  const points = coordinates[0];
  let latSum = 0;
  let lngSum = 0;
  const count = points.length - 1; // Exclude closing point
  
  for (let i = 0; i < count; i++) {
    lngSum += points[i][0];
    latSum += points[i][1];
  }
  
  return [latSum / count, lngSum / count];
}
